import './header.css';
import './footer.css';
import './styles.css';
import 'tailwindcss/tailwind.css';


export default function App() {
  return (
    <div className="App flex flex-col">
      <Navbar />
      <Welcome />
      <Footer />
    </div>
  );
}

function Navbar() {
  return (
    <header className="flex-inline md:flex md:flex-row">

    </header>
  );
}

function Welcome() {
  return (
    <main>
      <h1>Bienvenue sur PetMeeting!</h1>
      <div>
        <p>
        "Cet outil est à disposition des éleveurs de chats pour les aider dans leur travail de sélection, en facilitant la mise en relation entre les éleveurs sérieux et passionnés. PetMeeting permet de trouver facilement une saillie extérieure de qualité proche de chez soi. Pour reproducteurs LOOF, sélectionnés, testés, vaccinés, etc..."
        </p>
      </div>
      <div>Carousel</div>
    </main>
  );
}

function Footer() {
  return (
    <footer className='bottom-0 text-white p-2'>Tous droits réservés PetMeeting 2024</footer>
  );
}
